column84:
Um comentário sobre duas perguntas do questionário:

a) A questão sobre posições políticas deveria ter um leque maior de opções, por exemplo: centro-esquerda, centro-direita, extrema-esquerda, extrema-direita;
b) A pergunta sobre o grau de cientificidade das áreas do conhecimento humano sem antes questionar a concepção de ciência que o entrevistado possui pode gerar distorções nos resultados.
